import React from 'react';
import styled from "styled-components";
import { Card } from 'antd';
import Tags from './tags';

const { Meta } = Card;

const Wrapper = styled.div`
  margin-top: 40px;
  width: 346px;
  height: 350px;
  
`;

const StyledCard = styled(Card)`
  width: 346px;
  height: 350px;
`

const GatherCards = (props) => {
	return (
    <>
    <Wrapper>
      <img src="assets/images/gatherCardThumbnail.png" alt="thumbnail" />
      <div className="box">
        <div className="tags">
          <Tags></Tags>
          <Tags></Tags>
        </div>
        <div className="like">
          <img className="likeButton" src="assets/images/heart.png" alt="icon"/>
          <span>9,999</span>
        </div>
			</div>
    </Wrapper>

    </>
	);
};

export default GatherCards;
